import React, {Component} from 'react';

class Front_navbar extends Component{
  render(){
    return(
    <header>
      <nav>
          <ul>
              <li>Home</li>
              <li>About Us </li>
          </ul>
      </nav>
    </header>
  );
}
}

export default Front_navbar;
